import React from 'react';
import './style.css';

const SearchForm = props => {
    return (
        <form>
            <div className="form-group">
                <label for="book">Book</label>
                <input value={props.search} onChange={props.handleInputChange} type="text" className="form-control" aria-describedby="emailHelp" placeholder="Enter Book Name"></input>
            </div>
            <button type="submit" onSubmit={props.handleFormSubmit} className="btn btn-primary">Submit</button>
        </form>
    )
}

export default SearchForm;
